var log={print:function(t){var r=document.getElementById("output"),a=r.firstChild;a.appendData(t),a.appendData("\r\n")},clear:function(){var t=document.getElementById("output"),r=t.firstChild;r.deleteData(0,r.length)}},util={copy:function(t,r,a){for(var e=0;e<a.length;e++){var n=a[e];t[n]=r[n]}},hex:function(t){var r=t.toString(16);return 16>t?"0"+r:r},getHSBColor:function(t,r,a,e){var n=0,o=0,i=0;if(0==r)n=o=i=Math.round(255*a);else{var u=6*(t-Math.floor(t)),l=u-Math.floor(u),h=Math.round(255*a),c=Math.round(255*a*(1-r)),d=Math.round(255*a*(1-r*l)),f=Math.round(255*a*(1-r*(1-l)));switch(Math.floor(u)){case 0:n=h,o=f,i=c;break;case 1:n=d,o=h,i=c;break;case 2:n=c,o=h,i=f;break;case 3:n=c,o=d,i=h;break;case 4:n=f,o=c,i=h;break;case 5:n=h,o=c,i=d}}return e?["rgba(",String(n),",",String(o),",",String(i),",",String(e),")"].join(""):"#"+util.hex(n)+util.hex(o)+util.hex(i)}};